'use strict';

angular.module('apMesa.ghPage', [
  'ngSanitize',
  'ngAnimate',
  'ngRoute',
  'apMesa'
])
.config(function ($routeProvider, $locationProvider) {
  $locationProvider.hashPrefix('');
  $routeProvider
    .when('/', {
      templateUrl: 'views/main.html',
      controller: 'MainCtrl'
    })
    .when('/perf', {
      templateUrl: 'views/perf.html',
      controller: 'PerfCtrl'
    })
    .when('/max-height', {
      templateUrl: 'views/max-height.html',
      controller: 'MaxHeightCtrl'
    })
    .when('/expandable', {
      templateUrl: 'views/expandable.html',
      controller: 'ExpandableCtrl'
    })
    .when('/server-side-interaction', {
      templateUrl: 'views/server-side-interaction.html',
      controller: 'ServerSideCtrl'
    })
    .otherwise({
      redirectTo: '/'
    });
})
